implキーワードを使うことによって、構造体やenumに関連するメソッドを定義できます。 メソッドの最初の引数は必ずselfになり、これはメソッドを呼び出した構造体インスタンスのことを指します。 さらに、impl内には、メソッドだけでなく、関連関数を定義することができます。 これは、selfを引数に取らず、構造体に関連づけられているため、そう呼ばれます。 // 構造体の生成
struct User { name: String, age : u32, } //implブロック
impl User { // メソッドの定義 fn print_name(&self) { println!("{}",self.name); } // メソッドの定義 返り値あり fn double_age(&self) -> u32 { self.age * 2 } // 関連関数の定義 インスタンス生成関数 fn build_user(name: String, age: u32) -> User { User { name, age, } }
} fn main() { let user1 = User { name: String::from("user1"), age: 24, }; // メソッドの呼び出し user1.print_name(); println!("age * 2 = {}", user1.double_age()); // 関連関数へアクセス let user2 = User::build_user(String::from("user2"),35); user2.print_name();
}
